css:
@font-face {
  font-family: 'Octicons';
  src: url('atom://atom-sync/static/octicons.ttf');
}
@font-face {
  font-family: 'ProggyCleanTT';
  src: url('atom://atom-sync/static/ProggyClean.ttf');
}
.atom-sync .header {
  background: #282c34;
  border: solid 1px;
  border-top: 0;
  border-color: #181a1f;
  padding: 10px;
}
.atom-sync .header .btn_close,
.atom-sync .header .btn_empty {
  float: right;
  padding: 5px 8px;
  margin-left: 8px;
  margin-top: -10px;
  cursor: pointer;
  font-size: 16px;
  font-family: "Octicons";
}
.atom-sync .header .btn_close:hover,
.atom-sync .header .btn_empty:hover {
  color: #d7dae0;
}
.atom-sync .console {
  height: 150px;
  white-space: pre-wrap;
  overflow-x: hidden;
  overflow-y: auto;
  padding: 5px;
  border: solid 1px;
  border-top: 0;
  border-color: #181a1f;
  font-size: 15px;
  font-family: "ProggyCleanTT";
  line-height: 1.2;
  -webkit-font-smoothing: none;
}
.atom-sync .console .info {
  color: #6494ed;
}
.atom-sync .console .success {
  color: #73c990;
}
.atom-sync .console .error {
  color: #ff6347;
}
.atom-sync .console .warning {
  color: #e2c08d;
}
